import React, { useState, Component } from 'react';
import './HomeMain.css';
import ReactDOM from 'react-dom';
import { BrowserRouter as Router, Route, Switch, Link} from 'react-router-dom';
// Material UI Imports
import { Button } from '@material-ui/core'
import Modal from '@material-ui/core/Modal';

import MiddleSection from './MiddleSection'
// Image Imports
import photo from './HomeImages/Star-Logo-1.png';
import flag1 from './HomeImages/Maori-flag.png';
import flag2 from './HomeImages/NZ-Flag.png';
import user from './HomeImages/user-circle.png';
import hero from './HomeImages/Hero-image.png';



import { Body , Body2 } from './popup';

const Home = () => {
    const [open, setOpen] = useState(false);
    const [open2, setOpen2] = useState(false); 

    const handleOpen = () => {
        setOpen(true)
      }
  
    const handleClose = () => {
        setOpen(false)
        setOpen2(false)
      }
      
    const handleOpen2 = () => {
        setOpen2(true)
      }
  
      const handleClick = () => {
          if(open == true){
              setOpen(false)
              setOpen2(true)
          } else if (open2 == true){
            setOpen2(false)
            setOpen(true)
        }
      }

        return (
            <div>
                <Modal 
        open={open}
        onBackdropClick={handleClose}
    >
      <Body
      handleClick={handleClick}
      handleClose={handleClose}
      onBackdropClick={handleClose}
      />
    </Modal> 
    
    <Modal 
        open={open2}
        onBackdropClick={handleClose}
    >
      <Body2
      handleClick={handleClick}
      handleClose={handleClose}
      onBackdropClick={handleClose}
      />
    </Modal> 

      <div className="topNav">
      <Router>
        <div className="logo">
          <img className="img-main" src={photo} alt="logo"/>
        </div>
      
        <div className="navLinks">
            <ul>
              <a href="" className="navBar-link" target="blank" rel="noopener noreferrer"><li>Home</li></a>
              <a href="" className="navBar-link mid-link"><li>Features</li></a>
              <a href="" className="navBar-link"><li>Teachers</li></a>
            </ul>
        </div>
        <div className="sign">
          <div className="langDiv">
            <p className="langNav">lang<img className="img-flag langNav" src={flag2} alt="logo"/><img className="img-flag langNav" src={flag1} alt="logo"/></p>
          </div>
            
              <p>
                <img className="usericon" src={user} alt="logo"/>
             
                <button className="modalOpenButtons" onClick={handleOpen}>REGISTER</button> | <button className="modalOpenButtons" onClick={handleOpen2}>LOGIN</button>
              </p>
          </div>
          </Router>
        </div>
        
        <div className="header">
          <img className="hero" src={hero} alt="header"/>
        </div>
        
        <div className="stuff">
          <p>main stuff</p>
          
        </div>
        
        <MiddleSection />
      
        <div className="enroll">
          <p>enroll</p>
          <Button size="small" type="button" onClick={handleOpen}>Submit</Button>
        </div>

        <div className="footer">
          <p>footer</p>
        </div>
            </div>
        );
    }

export default Home
